window.bookSummaryJSON = "What happens when the very gods depend on mortals for help? That's what three very different young women find out when they are invited to Warrior's Peak. <p>The Malory Price Life Plan does not include a quixotic quest - but the strangers on Warrior's Peak claim that she must find a key that will release three souls held captive by an evil god.</p> <p>Little does she know that the quest will bring her two new friends: the love of her life - and danger beyond anyone's imagination.</p>"; 
